#https://leetcode-cn.com/contest/weekly-contest-217/problems/find-the-most-competitive-subsequence/

class Solution(object):
    def mostCompetitive(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: List[int]
        """
        print(nums)
        print(k)

        if k > len(nums):
            return []

        if k == 0:
            return []

        if len(nums) == k:
            return nums
        
        if len(nums) < k:
            return []

        mostComp = []
        
        #依次在 len - k + index 范围内找到那个最小的数
        indexSplit = 0
        minNum = nums[0]

        sameMinIndex = []
        for index in range(1 , len(nums) - k + 1):    
            if nums[index] < minNum:
                minNum = nums[index]
                indexSplit = index
                sameMinIndex.clear()
            elif nums[index] == minNum:
                sameMinIndex.append(index)
        
        
        mostComp.append(minNum)

        leftMaxNums = 0
        if len(sameMinIndex) > 0:
            for items in nums[ len(nums) - k + 1:]:
                if items < minNum:
                    leftMaxNums += 1

            if leftMaxNums < len(sameMinIndex):
                indexSplit = sameMinIndex[-1 - leftMaxNums]
                for index in range(len(sameMinIndex) - leftMaxNums):
                    mostComp.append(minNum)
                    if index >= k - 2:
                        break        

        if k > 1 + len(sameMinIndex):
            listSub = self.mostCompetitive(nums[indexSplit + 1:], k - len(mostComp))
        else:
            return mostComp

        for item in listSub:
            mostComp.append(item)

        return mostComp
        




